**Describe the bug**
Run model Inference with Openvino supported causes memory leak. The issue occurs only with dynamic input shape, which is [2, 3](height, width) in my case.


**System information**
- OS Platform and Distribution: Ubuntu18.04
- ONNX Runtime installed from source with Openvino(2021.2.200) supported
- ONNX Runtime version: 1.7.1

**To Reproduce**
